import React from 'react';
import img from "../resources/p1.png"

const Card = () => {
    return (
        <div className="col mb-5">
            <div class="card" style={{ width: "18rem" }}>
                <img src={img} class="card-img-top" alt="_card" />
            </div>
        </div>
    )
}

export default Card;
